   if (isLoading || newValue == '') {
	g_form.setValue('email','');

    return;
   }
   //Type appropriate comment here, and begin script below
	var useremailAdd = g_form.getReference('applicant', populateEmail);
}
function populateEmail(useremailAdd) { 
	g_form.setValue('email',useremailAdd.email);
}
